import React from 'react';
import Styles from './register.css';
import ReactDOMServer from 'react-dom/server';
import { Redirect } from 'react-router-dom';

class Register extends React.Component {
  constructor(props){
    super(props);

    this.state={
      Name: "",
      LastName: "",
    };
    };


  render(){
    return (
        <div className="backgroundRegister">
          <div><img class="logoRegister" src={require('../../images/logoBlanco.png')} /></div>
            <div className="containerRegister">
              <form>
                  <div class="form-group NameRegister">
                    <input  value={this.state.email} onChange={(event) => {this.setState({email: event.target.value});}} type="email" class="form-control NameRegisterInput" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Email"/>
                  </div>
                  <div class="form-group LastNameRegister">
                    <input value={this.state.pass} onChange={(event) => {this.setState({pass: event.target.value});}} type="password" class="form-control LastNameRegisterInput" id="exampleInputPassword1" placeholder="Password"/>
                  </div>
              </form>
            </div>
        </div>
    );
  }
}



export default Register;
